description:
If you loop it, sounds like a "hormigonera" (i didn't find its equivalent in english), a machine to mix cement, water and sand. 
A remix of 15025_reinsamba_dinosaur1_dn2.wav (A).
1. Cut the end of A = B; 
2. Copy B; 
3. Reverse B = C; 
4. Mix B and C = D; 
5. Change D's pitch a third up.
